import React from "react";
import { useRouteMatch } from "react-router-dom";

export default function Deck({ deck }){
    const { url } = useRouteMatch();
    return (
        <>
            <Breadcrumb page={url} deck={deck} />
            <h1>{deck}</h1>
        </>
    )
}
